import IMG from '../assets/loginbg.jpg'


const Card = (props) => {
    const image = {
        backgroundPosition: 'center',/* Center the image */
        backgroundRepeat: 'no-repeat', /* Do not repeat the image */
        backgroundSize: 'cover',
        backgroundImage : IMG
    }
    return (
        <div className='w-5/6 h-3/5 shadow-cardShadow mb-5 mt-12 m-auto'>
            <section className='w-full block image' style={image}> 
            </section>
            <section className=" p-3 rounded-bl-3xl h-1/3" style={{'background':props.color}}>
            <h1>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Laborum tempora vero doloribus, numquam fuga possimus hic dolore iure magni error eos sed architecto alias vel in et, quis reiciendis temporibus.</h1>
            </section>
        </div>
    )
}

export default Card;
